    nonprime1915::Test1915NonPrimeParams, nonprime2035::Test2035NonPrimeParams,
    nonprime2155::Test2155NonPrimeParams
};
use dep::bigint::BigNumParamsTrait;

type TestMod230 = BigNum<2, Test230NonPrimeParams>;
